import React from 'react'
import banner from "../images/5.jpg";
import "./StyleSheet/Banner.jsx";
const Banner = () => {
    return (
        <div className="Banner__container">
          <img src={banner} alt="Homepage Banner" />
        </div>
    )
}

export default Banner
